style.css:
/* i really want this to be global */

.row1, .data1 {
    background-color: #F3F3E9;
    text-align: left;
}

.row2, .data2 {
    background-color: #E6E6CC;
    text-align: left;
}

tr.data1 td, tr.data2 td , tr.data3 td {
    background-color: #00161c !important;
    font-family: arial, tahoma, verdana, helvetica, sans-serif, serif;
    font-size: smaller;
}

tr.data1:hover td, tr.data2:hover td , tr.data3:hover td {
    background-color: #336699 !important;
    color: #ccc;
    font-family: arial, tahoma, verdana, helvetica, sans-serif, serif;
    font-size: smaller;
}

tr.data1:hover a, tr.data2:hover a, tr.data3:hover a {
    background-color: #336699 !important;
    color: #ccc;
    font-family: arial, tahoma, verdana, helvetica, sans-serif, serif;
    font-size: smaller;
}

body, #r_memo, tr, td {
    background-image: none !important;
    background-color: #003f4f !important;
    color: #93A1A1;
}

.topbar, .topbar * {
    background-color: #003f4f !important;
}

.trail, .tab {
    background-color: #003f4f !important;
}

th.data {
    color: #ccc;
    background-color: #003f4f !important;
    font-family: arial, tahoma, verdana, helvetica, sans-serif, serif;
    font-size: smaller;
}

textarea {
    color: #ccc;
    background-color: #003f4f !important;
}

div.logo {
    background-image: url(data:image/png;base64,);
}
